import styles from './PageContainer.module.scss';

const PageContainer = ({title, buttons, onClick, content}) => {
    return (
        <div>
            <header>
                <h1>{title}</h1>

                <div>
                    buttons...
                </div>
            </header>
            <main>
                {content}
            </main>
        </div>
    );
};

export default PageContainer;
